namespace Search\Model;

use PHPUnit\Framework\TestCase;
use Search\Model\License;

class LicenseTest extends TestCase
{
    public function setUp()
    {
        $this->responseLogger = new ResponseLogger();
        $this->searchLogger = new SearchLogger();
        $this->serviceLogger = new ServiceLogger();
        $this->restraintLogger = new RestraintLogger();
        $this->license = new License($this->responseLogger, $this->searchLogger, $this->serviceLogger, $this->restraintLogger);
        parent::setUp();
    }

    /**
     * Проверка обработки входного запроса
     */
    public function testCreateRequest()
    {
        $array = array('driver_license' => '77YЕ456331');
        $request = new \stdClass();
        $request->driverLicense = '77УЕ456331';
        $this->assertEquals($request, $this->license->createRequest($array));
        $this->assertEquals('77YЕ456331', $this->license->searchLogger->search_string);
    }


